children.text:
body {
    font-family: Arial, sans-serif;
    margin: 0;
    padding: 20px;
    color: #333;
}
h1 {
    text-align: center;
    margin-bottom: 30px;
}
h2 {
    margin-top: 0px;
    padding-bottom: 5px;
    border-bottom: 1px solid #ddd;
}
.test-case {
    margin-bottom: 40px;
    padding: 20px;
    background-color: #f9f9f9;
    border-radius: 5px;
    display: inline-block;
    width: 400px;
    vertical-align: top;
}
.container {
    border: 2px solid #333;
    margin-top: 20px;
    position: relative;
}
.test-case.wide {
    width: 600px;
}
.wide .container {
    box-sizing: border-box;
}
.item {
    padding: 10px;
    box-sizing: border-box;
    text-align: center;
    position: relative;
}
.item:nth-child(1) { background-color: #ffcccc; }
.item:nth-child(2) { background-color: #ccffcc; }
.item:nth-child(3) { background-color: #ccccff; }
.item:nth-child(4) { background-color: #ffffcc; }
.item::after {
    content: attr(data-info);
    font-size: 12px;
    display: block;
}
pre {
    background-color: #f5f5f5;
    padding: 10px;
    border-radius: 4px;
    overflow-x: auto;
}
.explanation {
    margin-top: 15px;
    padding: 10px;
    background-color: #e9f7fe;
    border-radius: 4px;
}
/* Specific test styles */
.basic-layout .container {
    width: 400px;
    height: 300px;
    display: flex;
    gap: 10px;
}
.basic-layout .item {
    width: 100px;
    height: 100px;
}
.wrap-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    flex-wrap: wrap;
    gap: 10px;
}
.wrap-test .item {
    width: 200px;
    height: 80px;
}
.align-items-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    align-items: center;
    gap: 10px;
}
.align-items-test .item:nth-child(1) {
    width: 150px;
    height: 100px;
}
.align-items-test .item:nth-child(2) {
    width: 150px;
    height: 150px;
}
.column-direction-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    flex-direction: column;
    gap: 10px;
}
.column-direction-test .item {
    width: 200px;
    height: 100px;
}
.flex-grow-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    gap: 10px;
}
.flex-grow-test .item:nth-child(1) {
    flex-grow: 1;
    height: 100px;
}
.flex-grow-test .item:nth-child(2) {
    flex-grow: 2;
    height: 100px;
}
.justify-content-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    justify-content: space-evenly;
    gap: 10px;
}
.justify-content-test .item {
    width: 120px;
    height: 100px;
}
.row-reverse-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    flex-direction: row-reverse;
    gap: 10px;
}
.row-reverse-test .item {
    width: 150px;
    height: 100px;
}
.absolute-positioning-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    gap: 10px;
}
.absolute-positioning-test .item:nth-child(2) {
    position: absolute;
    left: 0;
    top: 0;
}
.hidden-visibility-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    gap: 10px;
}
.hidden-visibility-test .item:nth-child(2) {
    visibility: hidden;
}
.flex-basis-test .container {
    width: 400px;
    height: 300px;
    display: flex;
    gap: 10px;
}
.flex-basis-test .item:nth-child(1) {
    flex-basis: 150px;
    height: 100px;
}
.flex-basis-test .item:nth-child(2) {
    flex-basis: 200px;
    height: 100px;
}

/* Nested Content Test Styles */
.nested-text-test .container {
    width: 600px;
    height: 200px;
    display: flex;
    gap: 15px;
    padding: 10px;
}
.nested-text-test .item {
    flex: 1;
    padding: 15px;
    text-align: left;
    line-height: 1.4;
    font-size: 12px;
}
.nested-text-test .item:nth-child(1) { text-align: center; }
.nested-text-test .item:nth-child(3) { text-align: right; }
.nested-text-test .highlight { font-weight: bold; color: #d63384; }
.nested-text-test .small-text { font-size: 10px; color: #666; }

.nested-blocks-test .container {
    width: 600px;
    height: 250px;
    display: flex;
    gap: 20px;
    padding: 15px;
}
.nested-blocks-test .item {
    flex: 1;
    padding: 10px;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
}
.nested-blocks-test .nested-div {
    margin: 8px 0;
    padding: 8px;
    background-color: #e9ecef;
    border-left: 3px solid #6c757d;
    font-size: 11px;
}
.nested-blocks-test h3 {
    margin-bottom: 8px;
    font-size: 12px;
    color: #495057;
}

.mixed-inline-test .container {
    width: 600px;
    height: 280px;
    display: flex;
    gap: 15px;
    padding: 15px;
}
.mixed-inline-test .item {
    flex: 1;
    padding: 12px;
    line-height: 1.5;
    font-size: 12px;
}
.mixed-inline-test .bold { font-weight: bold; }
.mixed-inline-test .italic { font-style: italic; }
.mixed-inline-test .code {
    font-family: 'Courier New', monospace;
    background-color: #f8f9fa;
    padding: 2px 4px;
    border: 1px solid #dee2e6;
}
.mixed-inline-test a { color: #0d6efd; text-decoration: none; }

.nested-flex-test .container {
    width: 600px;
    height: 300px;
    display: flex;
    gap: 15px;
    padding: 10px;

}
.nested-flex-test .item {
    flex: 1;
    padding: 10px;
}
.nested-flex-test .nested-flex {
    display: flex;
    flex-direction: column;
    gap: 8px;
    height: 100%;
}
.nested-flex-test .nested-item {
    flex: 1;
    padding: 8px;
    background-color: #e9ecef;
    border: 1px solid #adb5bd;
    text-align: center;
    font-size: 11px;
}
.nested-flex-test h5 {
    margin-bottom: 8px;
    font-size: 12px;
    color: #495057;
}

.column-content-test .container {
    width: 600px;
    height: 500px;
    display: flex;
    flex-direction: column;
    gap: 15px;
    padding: 15px;
}
.column-content-test .item {
    flex: 1;
    padding: 15px;
}
.column-content-test h4 {
    margin-bottom: 10px;
    font-size: 13px;
    color: #495057;
    text-align: center;
}
.column-content-test .nested-section {
    margin: 10px 0;
    padding: 10px;
    background-color: #e9ecef;
    border-left: 3px solid #6c757d;
    font-size: 11px;
}

.complex-content-test .container {
    width: 600px;
    height: 400px;
    display: flex;
    gap: 20px;
    padding: 15px;
}
.complex-content-test .item {
    flex: 1;
    padding: 15px;
    overflow: hidden;
}
.complex-content-test h3 {
    margin-bottom: 12px;
    font-size: 14px;
    color: #495057;
    border-bottom: 2px solid #dee2e6;
    padding-bottom: 5px;
}
.complex-content-test .content-section {
    margin: 10px 0;
    padding: 10px;
    background-color: #ffffff;
    border: 1px solid #e9ecef;
    border-radius: 4px;
    font-size: 11px;
}
.complex-content-test .highlight-box {
    background-color: #fff3cd;
    border: 1px solid #ffeaa7;
    padding: 8px;
    margin: 8px 0;
    border-radius: 3px;
}
.complex-content-test .code-block {
    font-family: 'Courier New', monospace;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
    padding: 8px;
    margin: 8px 0;
    font-size: 10px;
    border-radius: 3px;
}
